/*
For Part 1 I wrote a fairly simple walk process using a recursive CTE. No big deal there.

Part 2 is where things got interesting, and I totally lucked out. I decided to assume that
the answer would appear within 10,000 iterations, so I converted my CTE into a WHILE loop and
ran all 10,000 cycles, saving each state into a temporary table. Then I made another assumption:
A drawing probably has lower entropy and more clustering than the usual robot positions. I decided
to check for this using standard deviation - and it worked like a charm.

I spent some time writing some code to help visualize the output in SSMS, when I suddenly remembered
that the geometry data type has built-in visualization! Pretty cool. I pasted the output from my 
input below.
*/

