declare @maxx int = 101, @maxy int = 103;

if object_id('tempdb..#robots') is not null
    drop table #robots;

select
    s1.robot,
    v.*
into #robots
from
(
    select
        s.value,
        row_number() over (order by 1/0) as robot
    from string_split(replace(@n, char(10), ''), char(13)) as s
) as s1
cross apply 
(
    select
        min(case left(ss.value, 1) when 'p' then pairs.x else null end) as px,
        min(case left(ss.value, 1) when 'p' then pairs.y else null end) as py,
        min(case left(ss.value, 1) when 'v' then pairs.x else null end) as vx,
        min(case left(ss.value, 1) when 'v' then pairs.y else null end) as vy
    from string_split(s1.value, ' ') as ss
    cross apply
    (
        select
            max(case when p_num = 1 then p1.value else null end) as x,
            max(case when p_num = 2 then p1.value else null end) as y
        from
        (
            select
                convert(int, p0.value) as value,
                row_number() over (order by 1/0) as p_num
            from string_split(right(ss.value, len(ss.value) - 2), ',') as p0
        ) as p1
    ) as pairs
) as v;


-- #1
declare @seconds int = 100;

with
c as
(
    select
        robot,
        px,
        py,
        vx,
        vy,
        convert(int, 0) as seconds
    from #robots

    union all

    select
        robot,
        case when p.px >= @maxx then p.px - @maxx when p.px < 0 then @maxx + p.px else p.px end as px,
        case when p.py >= @maxy then p.py - @maxy when p.py < 0 then @maxy + p.py else p.py end as py,
        vx,
        vy,
        seconds + 1
    from c
    cross apply
    (
        values(px+vx, py+vy)
    ) as p (px, py)
    where
        seconds < @seconds
)
select
    round(exp(sum(log(robots))), 0)
from
(
    select
        c1.quad, count(*) as robots
    from
    (
        select
            c0.*,
            case
                when lefth + toph = 2 then 1
                when lefth + bottomh = 2 then 2
                when righth + toph = 2 then 3
                when righth + bottomh = 2 then 4
                else 0
            end as quad
        from
        (
            select
                c.*,
                (@maxy / 2) + 1 as my,
                case when c.px between 0 and (@maxx / 2) - 1 then 1 else 0 end as lefth,
                case when c.px > (@maxx / 2) then 1 else 0 end as righth,
                case when c.py between 0 and (@maxy / 2) - 1 then 1 else 0 end as toph,
                case when c.py > (@maxy / 2) then 1 else 0 end as bottomh
            from c
            where
                seconds = @seconds
        ) as c0
    ) as c1
    where
        c1.quad > 0
    group by
        c1.quad
) as c2;


-- #2
if object_id('tempdb..#c') is not null
    drop table #c;

select
    robot,
    px,
    py,
    vx,
    vy,
    convert(int, 0) as seconds
into #c
from #robots;

create clustered index x on #c (seconds);

declare @max_seconds int = 10000;
declare @s int = 0;

set nocount on;

while @s < @max_seconds
begin
    insert into #c
    select
        robot,
        case when p.px >= @maxx then p.px - @maxx when p.px < 0 then @maxx + p.px else p.px end as px,
        case when p.py >= @maxy then p.py - @maxy when p.py < 0 then @maxy + p.py else p.py end as py,
        vx,
        vy,
        seconds + 1
    from #c as c
    cross apply
    (
        values(px+vx, py+vy)
    ) as p (px, py)
    where
        c.seconds = @s;

    set @s += 1;
end;

declare @tree_seconds int = (
    select top(1)
        seconds
    from #c
    group by
        seconds
    order by stdev(px), stdev(py)
);

select
    geometry::UnionAggregate(geometry::Point(px, -py, 0))
from #c
where
    seconds = @tree_seconds;

-- my input's tree...
select geometry::STGeomFromWKB(, 0);
